    public function validateCoupon() {
        $rules = [
            'coupon' => 'required|exists:coupons,coupon',
            'user_email' => 'required|email|exists:users,email',
            'restaurant_code' => 'required|exists:restaurants,code_name',
            'total_amount' => 'required|numeric',
            'restaurants_order_id' => 'integer'
        ];

        $validator = Validator::make(request()->all(), $rules);


        //pass validator errors as errors object for ajax response
        if ($validator->fails())
            return response()->json(['errors' => $validator->errors()], 422);

        //Get user credentials by there email
        $user = \App\User::where('email', request('user_email'))->first();

        //Check whether the requested coupon related to the requested user or active coupon.
        if ($user->coupon->coupon != request('coupon') || !$user->coupon->is_active) {
            return response()->json(['errors' => 'invalid coupon'], 422);
        }

        //Fetch restaurant info based on requested restaurant_code
        $restaurant = \App\Restaurant::where('code_name', request('restaurant_code'))->first();

        //Check whether selected restaurant active or not
        if (!$restaurant->is_active)
            return response()->json(['errors' => "restaurant code deactivated"], 422);


        //Check restaurant discount type and calculate output result based on discount types
        if ($restaurant->discount_type->name == 'percentage') {

            //Get user and restaurant_code related coupon_discount information
            $coupon_discount = $user->coupon->coupon_group->coupon_discounts()->whereHas('restaurant', function($query) {
                        $query->where('code_name', request('restaurant_code'));
                    })->first();

            //Check whether coupon discount expired and return response
            if ($coupon_discount->expiration_date != null && strtotime($coupon_discount->expiration_date) < time()) {
                return response()->json(['errors' => "coupon expired"], 422);
            }

            //before response log in coupon_statistics table
            $couponStatistics = new \App\CouponStatistics;
            $couponStatistics->coupon_id = request('coupon');
            $couponStatistics->restaurant()->associate($restaurant);
            $couponStatistics->discount_percentage = $coupon_discount->percentage;
            $couponStatistics->amount = request('total_amount');
            $couponStatistics->discount_amount = ($coupon_discount->percentage / 100) * request('total_amount');

            $couponStatistics->save();

            $data = [
                'discount_percentage' => $coupon_discount->percentage,
                'discount_amount' => $couponStatistics->discount_amount
            ];

            return response()->json(['message' => "Coupon discount found", 'data' => $data], 200);
        } elseif ($restaurant->discount_type->name == 'point') {

            //Condition to get point based purchase information from validateCoupon endpoint
            //Restaurant related point details
            $point_detail = $restaurant->point_detail;

            //If request restaurant have't any point based discount code will terminate here and return this error msg.
            if (!$point_detail)
                return response()->json(['errors' => ['restaurant_code' => 'have no point based discount']], 400);
            elseif (!$point_detail->is_active)
                return response()->json(['errors' => ['restaurant_code' => 'point based discount deactivated']], 400);

            /*
              Code to calculate total point earned and used by a perticular user and output available discount amount
              based on restaurants point slab and save it to associated table.
             */

            $total_point_earned = $user->purchase_points()->where('point_detail_id', $point_detail->id)->sum('point_earned');

            $total_point_used = $user->purchase_points()->where('point_detail_id', $point_detail->id)->sum('point_used');

            $point_earned = floor(request('total_amount') * $point_detail->purchase_slab);

            $point_balance = ($total_point_earned - $total_point_used) + $point_earned;

            $available_discount_amount = floor($point_balance / $point_detail->discount_slab);

            //$point_used=$available_discount_amount * $point_detail->discount_slab;
            //Save purchase point information
            $purchase_point = new \App\PurchasePoint;
            $purchase_point->user()->associate($user);
            if (request()->has('restaurants_order_id')) {
                $purchase_point->restaurants_order_id = request('restaurants_order_id');
            }
            $purchase_point->point_detail()->associate($point_detail);
            $purchase_point->purchase_amount = request('total_amount');
            $purchase_point->point_earned = $point_earned;
            $purchase_point->save();

            //Code to return response
            $data = [
                'point_earned' => $point_earned,
                'point_balance' => $point_balance,
                'available_discount_amount' => $available_discount_amount
            ];

            return response()->json(['message' => "purchase point saved successfully", 'data' => $data], 200);
        } //End of elseif condition
    }

