    public function savePassword(Request $request) {
        $rules = [
            'email' => 'required|email|exists:users,email|max:255',
            'password' => 'required|min:6',
        ];
        $validator = Validator::make($request->all(), $rules);

        if ($validator->fails()) {
            //pass validator errors as errors object for ajax response
            return response()->json(['errors' => $validator->errors()], 422);
        }

        // grab credentials from the request
        $credentials = $request->only('email', 'password');

        $find = User::where(['email' => $credentials['email'], 'password' => null])->first();
        if ($find !== null) {
            //insert password
            $find->password = Hash::make($credentials['password']);
            $find->save();

            return response()->json(['message' => 'password saved successfully'], 200);
        } else {
            return response()->json(['message' => 'password already exits'], 400);
        }
    }

    public function registration(Request $request) {
