            'post_code' => 'required',
            //'address_line1' => 'required',
            'restaurant_code' => 'required|exists:restaurants,code_name',
            'email' => 'required|email|unique:users,email|max:255',
                //'password' => 'required|min:6',
        ];

        $validator = Validator::make($request->all(), $rules);

//        $email = new \hbattat\VerifyEmail($request->email, config('mail.from.address'));
//
//        if (!$email->verify())
//            return response()->json(['message' => 'Sorry!, requested email address does not exists', 'data' => NULL, 'status' => 'error'], 422);
//        unset($email);
//
        if ($validator->fails()) {
            //pass validator errors as errors object for ajax response
            return response()->json(['errors' => $validator->errors()], 422);
        }

        // grab credentials from the request
        //$request = $request->all();
        //If request have no password field
        if ($request->password) {
            $random_password_flag = false;
        } else {
            $random_password_flag = true;
            $request->password = substr(str_shuffle('abcdefghijklmnopqrstuvwxyzABCDEFGHIJKLMNOPQRSTUVWXYZ0123456789'), 0, 10);
        }//End of if($request->password)
        //dd($password_to_mail);

        DB::beginTransaction();
        $user = new User;
        $user->name = $request->first_name . ' ' . $request->last_name;
        $user->email = $request->email;
        $user->password = Hash::make($request->password);

        if ($user->save()) {

            $user_id = $user->id;

            //This code to save password in random_passwords table if no password give in request
            if ($random_password_flag) {

                $random_password = new \App\RandomPassword();
                $random_password->user_id = $user->id;
                $random_password->password = $request->password;

                if (!$random_password->save()) {
                    DB::rollBack();
                    return response()->json(['message' => 'sorry, unable to save random password'], 500);
                }
            }
            //End of code to save password in random_passwords table if no password give in request
        } else {
            DB::rollBack();
            return response()->json(['message' => 'Unable to save user, unknown error'], 400);
        }

        //get restaurant id by restaurant code_name
        $restaurant = Restaurant::where(['code_name' => $request['restaurant_code'], 'is_active' => 1])->first();
        $user_details = new UserDetails();
        $user_details->user_id = $user_id;
        $user_details->restaurant_id = $restaurant->id;
        $user_details->first_name = $request->first_name;
        $user_details->last_name = $request->last_name;
        $user_details->address_line1 = $request->address_line1;
        $user_details->post_code = $request->post_code;
        $user_details->address_line2 = $request->address_line2;
        $user_details->gender = $request->gender;
        $user_details->city = $request->city;
        $user_details->country = $request->country;
        $user_details->phone = $request->phone;
        $user_details->mobile = $request->mobile;
        $user_details->birthday = $request->birthday;
        $user_details->partner_birthday = $request->partner_birthday;
        $user_details->anniversary_date = $request->anniversary_date;
        $user_details->special_day = $request->special_day;
        $user_details->special_note = $request->special_note;



        $user_details->billing_address_line1 = $request->billing_address_line1;
        $user_details->billing_address_line2 = $request->billing_address_line2;
        $user_details->billing_post_code = $request->billing_post_code;
        $user_details->billing_city = $request->billing_city;
        $user_details->billing_country = $request->billing_country;

        $user_details->registration_date = \Carbon\Carbon::now();
        if ($user_details->save()) {
            $restaurant_id = $restaurant->id;

            //get current active discount group
            $group = CouponDiscounts::where(['restaurant_id' => $restaurant_id, 'is_active' => 1])->first();

            if ($group !== null) {
                $group_id = $group->coupon_group_id;
            } else {
                DB::rollBack();
                return response()->json(['message' => 'Unable to get active discount group for this restaurant'], 400);
            }
            //TODO we need to generate coupon and attache with new user
            $find = Coupon::where(['coupon_group_id' => $group_id, 'is_active' => 1, 'user_id' => null])->first();

            if ($find !== null) {
                $find->user_id = $user_id;
                $find->save();

                $user_details->orderpin = $find->coupon;
                $user_details->save();

                DB::commit();

                /* Send Registration email to customer */
                try {
                    Mail::to($user)
                            ->send(new \App\Mail\RegistrationEmail($restaurant->name, $user->name, $user->email, $request->password));
                } catch (Exception $ex) {
                    
                }

                /* End of sending registration email to sender */
                $user = User::with(['detail', 'coupon'])->find($user_id);


                $coupon_discount = $user->coupon->coupon_group->coupon_discounts()->whereHas('restaurant', function($query) use(&$user) {
                            $query->where([['id', $user->detail->restaurant_id], ['coupon_group_id', $user->coupon->coupon_group_id]]);
                        })->first();

                $couponinfo = [
                    'coupon_group' => $coupon_discount->coupon_group->name,
                    'expiration_date' => $coupon_discount->expiration_date,
                    'percentage' => $coupon_discount->percentage,
                    'is_active' => $coupon_discount->is_active,
                    'coupon' => $user->coupon->coupon
                ];
                return response()->json(['message' => 'User registration successful', 'data' => ['user_id' => $user_id, 'coupon' => $find->coupon], 'user' => $user, 'couponinfo' => $couponinfo], 200);
            } else {
                DB::rollBack();
                return response()->json(['message' => 'No coupon available to tag with user'], 400);
            }
        } else {
            DB::rollBack();
            return response()->json(['message' => 'Unable to register new user try again later.'], 400);
        }
    }

    public function authenticate(Request $request) {
        $rules = [
            'email' => 'required|email|max:255',
            'password' => 'required',
        ];
        $validator = Validator::make($request->all(), $rules);

        if ($validator->fails()) {
            //pass validator errors as errors object for ajax response
            return response()->json(['errors' => $validator->errors()], 422);
        }

        // grab credentials from the request
        $credentials = $request->only('email', 'password');

        try {
            // attempt to verify the credentials and create a token for the user
            if (!$token = JWTAuth::attempt($credentials)) {
                return response()->json(['errors' => 'invalid_credentials'], 401);
            }
        } catch (JWTException $e) {
            // something went wrong whilst attempting to encode the token
            return response()->json(['errors' => 'could_not_create_token'], 500);
        }

        $user = User::with('detail')->where('email', $credentials['email'])->first();

        $coupon_discount = $user->coupon->coupon_group->coupon_discounts()->whereHas('restaurant', function($query) use(&$user) {
                    $query->where([['id', $user->detail->restaurant_id], ['coupon_group_id', $user->coupon->coupon_group_id]]);
                })->first();
        if ($coupon_discount) {
            $couponinfo = [
                'coupon_group' => $coupon_discount->coupon_group->name,
                'expiration_date' => $coupon_discount->expiration_date,
                'percentage' => $coupon_discount->percentage,
                'is_active' => $coupon_discount->is_active,
                'coupon' => $user->coupon->coupon
            ];
        } else {
            $couponinfo = false;
        }

        // all good so return the token
        return response()->json(['token' => $token, 'user' => $user, 'couponinfo' => $couponinfo], 200);
    }

    public function generateCoupon($count = null) {
        $duplicate_pin = [];
        $not_saved_coupon = [];
        $success_data = [];
        for ($i = 0; $i < $count; $i++) {
            $pin = mt_rand(100000, 999999);
            $find = Coupon::where('coupon', $pin)->first();
            if ($find !== null) {
                array_push($duplicate_pin, $pin);
                continue;
            }
            $coupon = new Coupon;

            $coupon->coupon_group_id = 1;
            $coupon->coupon = $pin;
            $coupon->user_id = null;

            $coupon_saved = $coupon->save();
            if (!$coupon_saved) {
                array_push($not_saved_coupon, $pin);
            } else {
                array_push($success_data, $coupon);
            }
        }

        echo json_encode([
            'duplicate_pin' => $duplicate_pin,
            'not_saved_coupon' => $not_saved_coupon,
            'success_data' => $success_data
        ]);
    }

