        }

        return response()->json(['errors' => 'Coupon not found for this email'], 404);
    }

    public function customers(Request $request) {

        //Initiating defaults values
        $data = null;
        $top = 25;
        $email = null;
        $name = null;

        //Assign to default values if GET input exists
        if ($request->top)
            $top = $request->top;
        if ($request->email)
            $email = $request->email;
        if ($request->name)
            $name = $request->name;

        $users = \App\User::doesntHave('roles');

        if ($name)
            $users = $users->where('name', 'like', '%' . $name . '%');

        if ($name && $email)
            $users = $users->orWhere('email', 'like', $email . '%');

        elseif ($email)
            $users = $users->where('email', 'like', $email . '%');

        $data = $users->with('detail')->paginate($top);

        return response()->json(['message' => 'requested customers list', 'data' => $data, 'status' => 'success']);
    }

    public function customer(Request $request, $id) {

        $user = User::with(['detail', 'coupon'])->find($id);


        $coupon_discount = $user->coupon->coupon_group->coupon_discounts()->whereHas('restaurant', function($query) use(&$user) {
                    $query->where([['id', $user->detail->restaurant_id], ['coupon_group_id', $user->coupon->coupon_group_id]]);
                })->first();

        $couponinfo = [
            'coupon_group' => $coupon_discount->coupon_group->name,
            'expiration_date' => $coupon_discount->expiration_date,
            'percentage' => $coupon_discount->percentage,
            'is_active' => $coupon_discount->is_active,
            'coupon' => $user->coupon->coupon
        ];

        if (!$user)
            return response()->json(['message' => 'requested customer not found', 'data' => null, 'status' => 'error'], 404);

        return response()->json(['message' => 'request customers information', 'data' => $user, 'status' => 'success', 'user' => $user, 'couponinfo' => $couponinfo], 200);
    }

