    public function purchasePointInfo() {

        /*
          Action to get point based information from purchasePointInfo endpoint
          INPUT is: coupon(required), user_email(required), restaurant_code(required), total_amount (optional).
          And OUTPUT is: point_earned, point_balance, available_discount_amount(in pound).
         */

        $rules = [
            'coupon' => 'required|exists:coupons,coupon',
            'user_email' => 'required|email|exists:users,email',
            'restaurant_code' => 'required|exists:restaurants,code_name',
            'total_amount' => 'numeric',
        ];

        $validator = \Validator::make(request()->all(), $rules);

        if ($validator->fails())
            return response()->json(['errors' => $validator->errors()], 422);

        //Request related user details
        $user = \App\User::where('email', request('user_email'))->first();

        //Check whether the requested coupon related to the requested user or not
        if ($user->coupon->coupon != request('coupon') || !$user->coupon->is_active) {
            return response()->json(['errors' => 'invalid coupon'], 422);
        }

        //Fetch restaurant info based on requested restaurant_code
        $restaurant = \App\Restaurant::where('code_name', request('restaurant_code'))->first();

        //Check whether selected restaurant active or not
        if (!$restaurant->is_active)
            return response()->json(['errors' => "restaurant code deactivated"], 422);

        //Requested related restaurant details related to restaurant_code
        $restaurant = \App\Restaurant::where('code_name', request('restaurant_code'))->first();

        //Restaurant related point details
        $point_detail = $restaurant->point_detail;

        //If request restaurant have't any point based  or is_active=0, discount code will terminate here and return this error msg.
        if (!$point_detail)
            return response()->json(['errors' => ['restaurant_code' => 'have no point based discount']], 400);
        elseif (!$point_detail->is_active)
            return response()->json(['errors' => ['restaurant_code' => 'point based discount deactivated']], 400);

        /*
          Code to calculate total point earned and used by a perticular user and output available discount amount
          based on restaurants point slab.
         */

        $total_point_earned = $user->purchase_points()->where('point_detail_id', $point_detail->id)->sum('point_earned');

        $total_point_used = $user->purchase_points()->where('point_detail_id', $point_detail->id)->sum('point_used');

        if (request()->has('total_amount'))
            $point_earned = floor(request('total_amount') * $point_detail->purchase_slab);
        else
            $point_earned = 0;

        $point_balance = ($total_point_earned - $total_point_used) + $point_earned;

        $available_discount_amount = floor($point_balance / $point_detail->discount_slab);

        $data = [
            'point_earned' => $point_earned,
            'point_balance' => $point_balance,
            'available_discount_amount' => $available_discount_amount
        ];

        return response()->json(['message' => "purchase point information", 'data' => $data], 200);
    }

    public function usePurchasePoint() {

        /*
          Action to insert point used information from usePurchasePoint endpoint
          INPUT is: coupon(required), user_email(required), restaurant_code(required), discount_amount(required), restaurants_order_id (optional). And OUTPUT is: point_used, point_balance, available_discount_amount(in pound).
         */

        $rules = [
            'coupon' => 'required|exists:coupons,coupon',
            'user_email' => 'required|email|exists:users,email',
            'restaurant_code' => 'required|exists:restaurants,code_name',
            'discount_amount' => 'required|numeric',
            'restaurants_order_id' => 'integer'
        ];

        $validator = \Validator::make(request()->all(), $rules);

        if ($validator->fails())
            return response()->json(['errors' => $validator->errors()], 422);

        //Request related user details
        $user = \App\User::where('email', request('user_email'))->first();

        //Check whether the requested coupon related to the requested user or not
        if ($user->coupon->coupon != request('coupon') || !$user->coupon->is_active) {
            return response()->json(['errors' => 'invalid coupon'], 422);
        }

        //Fetch restaurant info based on requested restaurant_code
        $restaurant = \App\Restaurant::where('code_name', request('restaurant_code'))->first();

        //Check whether selected restaurant active or not
        if (!$restaurant->is_active)
            return response()->json(['errors' => "restaurant code deactivated"], 422);

        //Condition to get point based purchase information from validateCoupon endpoint
        //Restaurant related point details
        $point_detail = $restaurant->point_detail;

        //If request restaurant have't any point based discount code will terminate here and return this error msg.
        if (!$point_detail)
            return response()->json(['errors' => ['restaurant_code' => 'have no point based discount']], 400);
        elseif (!$point_detail->is_active)
            return response()->json(['errors' => ['restaurant_code' => 'point based discount deactivated']], 400);

        /*
          Code to calculate total point earned and used by a perticular user and output available discount amount
          based on restaurants point slab and save it to associated table.
         */

        $total_point_earned = $user->purchase_points()->where('point_detail_id', $point_detail->id)->sum('point_earned');

        $total_point_used = $user->purchase_points()->where('point_detail_id', $point_detail->id)->sum('point_used');

        //Get purchase

        $point_balance = ($total_point_earned - $total_point_used);

        $available_discount_amount = floor($point_balance / $point_detail->discount_slab);

        //Check whether requested discount exceeds available discount amount
        if (request('discount_amount') > $available_discount_amount) {
            return response()->json(['errors' => ['discount_amount' => 'requested discount amount exceed available discount amount']], 400);
        }

        //Convert discount amount to point according to restaurants discount slab.
        $point_used = floor(request('discount_amount') * $point_detail->discount_slab);


        //Save purchase point information
        $purchase_point = new \App\PurchasePoint;
        $purchase_point->user()->associate($user);
        if (request()->has('restaurants_order_id')) {
            $purchase_point->restaurants_order_id = request('restaurants_order_id');
        }
        $purchase_point->point_detail()->associate($point_detail);
        $purchase_point->purchase_amount = 0.00;
        $purchase_point->point_used = $point_used;

        if (!$purchase_point->save())
            return response()->json(['errors' => "failed to save purchase point deduction"], 422);


        //Code to return response
        $data = [
            'point_used' => $point_used,
            'point_balance' => $point_balance - $point_used,
            'available_discount_amount' => $available_discount_amount - request('discount_amount')
        ];

        return response()->json([
                    'message' => "used discount amount deducted from purchase point",
                    'data' => $data], 200 //HTTP status code
        );
    }

    public function updateCustomer(Request $request) {
        $rules = [
            'customer_id' => 'required',
            'first_name' => 'required',
            'last_name' => 'required',
            'post_code' => 'required',
                //'address_line1' => 'required',
        ];
        $customer_id = $request->customer_id;
        if (!$user = User::with('detail')->find($customer_id)) {
            $rules['customer'] = 'required';
        }
        $messages = [
            'customer.required' => 'Customer not found!',
        ];
        $validator = Validator::make($request->all(), $rules, $messages);

        if ($validator->fails()) {
            //pass validator errors as errors object for ajax response
            return response()->json(['errors' => $validator->errors()], 422);
        }

        DB::beginTransaction();
        $user_details = UserDetails::where('user_id', $customer_id)->first();


        $user_details->first_name = $request->first_name;
        $user_details->last_name = $request->last_name;
        $user_details->address_line1 = $request->address_line1;
        $user_details->post_code = $request->post_code;
        $user_details->address_line2 = $request->address_line2;
        $user_details->gender = $request->gender;
        $user_details->city = $request->city;
        $user_details->country = $request->country;
        $user_details->phone = $request->phone;
        $user_details->mobile = $request->mobile;
        $user_details->birthday = $request->birthday;
        $user_details->partner_birthday = $request->partner_birthday;
        $user_details->anniversary_date = $request->anniversary_date;
        $user_details->special_day = $request->special_day;
        $user_details->special_note = $request->special_note;

        $user_details->billing_address_line1 = $request->billing_address_line1;
        $user_details->billing_address_line2 = $request->billing_address_line2;
        $user_details->billing_post_code = $request->billing_post_code;
        $user_details->billing_city = $request->billing_city;
        $user_details->billing_country = $request->billing_country;

        if ($user_details->save()) {
            DB::commit();
            $user = User::with(['detail', 'coupon'])->find($customer_id);
            $coupon_discount = $user->coupon->coupon_group->coupon_discounts()->whereHas('restaurant', function($query) use(&$user) {
                        $query->where([['id', $user->detail->restaurant_id], ['coupon_group_id', $user->coupon->coupon_group_id]]);
                    })->first();

            if ($coupon_discount) {
                $couponinfo = [
                    'coupon_group' => $coupon_discount->coupon_group->name,
                    'expiration_date' => $coupon_discount->expiration_date,
                    'percentage' => $coupon_discount->percentage,
                    'is_active' => $coupon_discount->is_active,
                    'coupon' => $user->coupon->coupon
                ];
            } else {
                $couponinfo = false;
            }
            // all good so return the token
            return response()->json(['user' => $user, 'couponinfo' => $couponinfo], 200);
        } else {
            DB::rollBack();
            return response()->json(['message' => 'Unable to register new user try again later.'], 400);
        }
    }

    public function updatePassword(Request $request) {
        $rules = [
            'user_id' => 'required|exists:users,id',
            'password' => 'required',
        ];

        $validator = Validator::make(request()->all(), $rules);


        //pass validator errors as errors object for ajax response
        if ($validator->fails()) {
            return response()->json(['errors' => $validator->errors()], 422);
        }
        //Get user credentials by there email
        $user_id = request('user_id');
        $user = \App\User::find($user_id);
        $user->password = Hash::make($request->password);
