    public function forgotPassword(Request $request) {
        $rules = [
            'email' => 'required|email',
        ];
        $validator = Validator::make(request()->all(), $rules);


        //pass validator errors as errors object for ajax response
        if ($validator->fails()) {
            return response()->json(['errors' => $validator->errors()], 422);
        }
        $user = User::with('detail')->where('email', request('email'))->first();
        if (!$user) {
            return response()->json(['message' => 'Not found'], 404);
        }
        $password = substr(str_shuffle('abcdefghijklmnopqrstuvwxyzABCDEFGHIJKLMNOPQRSTUVWXYZ0123456789'), 0, 10);
        $orderpin = $user->detail->orderpin;

        $user->password = Hash::make($password);
        $user->save();

        return response()->json(['message' => 'Success', 'new_password' => $password, 'orderpin' => $orderpin], 200);
    }

    public function defaultDiscount(Request $request) {
        $rules = [
            'restaurant_code' => 'required|exists:restaurants,code_name',
        ];
        $validator = Validator::make(request()->all(), $rules);


        //pass validator errors as errors object for ajax response
        if ($validator->fails()) {
            return response()->json(['errors' => $validator->errors()], 422);
        }
        $restaurant = Restaurant::with(['coupon_discounts' => function($query) {
                        $query->where('coupon_group_id', 1);
                    }])->where('code_name', request('restaurant_code'))->first();
        if (isset($restaurant->coupon_discounts[0])) {
            $discount = $restaurant->coupon_discounts[0]->percentage;
        } else {
            $discount = 0;
        }
        return response()->json(['message' => 'Success', 'discount' => $discount], 200);
    }

